import api from "../../../utils/api";
import { useState, useEffect } from 'react'


function Solicitações() {
    const [produtos, setProdutos] = useState([])
    const [token] = useState(localStorage.getItem('token') || '')

    // Pegar as minhas compras e armazenar na variavel produtos
    useEffect(() => {
        api.get('/produtos/minhasCompras', {
            headers: {
              Authorization: `Bearer ${JSON.parse(token)}`,
            },
          })
          .then((response) => {
            setProdutos(response.data)
          })
      }, [token])

  return (

    <section>
      <div>
        <h1>Minhas compras</h1>
      </div>
      <div>
        {produtos.length > 0 &&
          produtos.map((produto) => (
            <div key={produto._id}>
              <img
                src={`${process.env.REACT_APP_API}/images/produtos/${produto.imagens[0]}`}
                alt={produto.nome}
              />
              <span className="bold">{pet.name}</span>
              <div className={styles.contacts}>
                <p>
                  <span className="bold">Ligue para:</span> {pet.user.phone}
                </p>
                <p>
                  <span className="bold">Fale com:</span> {pet.user.name}
                </p>
              </div>
              <div className={styles.actions}>
                {pet.available ? (
                  <p>Adoção em processo</p>
                ) : (
                  <p>Parabéns por concluir a adoção</p>
                )}
              </div>
            </div>
          ))}
        {pets.length === 0 && <p>Ainda não há pets adotados!</p>}
      </div>
    </section>

  )
}

export default Solicitações
